INSERT INTO `cms_terms_condtition` (`id`, `description`, `status_id`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(3, '<h2>TERMS AND CONDITIONS:</h2><ol><li>The contract of ad space lease shall automatically terminate at the end of the period covered indicated above and may be renewed for such a period of time upon mutual agreement under mutually acceptable terms and conditions, reduced in writing and signed by the First Party as the LESSOR, herein referred to as DECOARTS., and the Second Party as the LESSEE.&nbsp;<br>&nbsp;</li><li>If within the contract period, the collateral (tarpaulin, duratrans, sintra boards) is considered damaged or faded, the LESSOR shall notify the LESSEE in writing. The LESSEE shall return the signed copy of the letter within seven (7) days from notification, otherwise, the LESSOR has the right to do the replacement/fixing with the cost of&nbsp; production subsequently reimbursed by the LESSEE<br>&nbsp;</li><li>The LESSOR will notify the lessee in writing sixty (60) days before the contract expires. The LESSEE shall return the signed copy of the letter thirty (30) days before the&nbsp;expiration of the contract. If the LESSEE fails to return a signed copy of the letter within the said period, the LESSOR will deem the contract renewed and active</li></ol>', 1, '2022-10-26 03:58:56', '1', '2022-12-07 02:37:56', '2');
